import React, { Component } from 'react'
import classes from './Auth.module.css'

export default class Auth extends Component {
  render() {
    return (
      <div className={classes.Auth}>
        <div>
          <h1>Authorization</h1>

          <form>
          </form>
            <input type="text"/>
            <input type="text"/>

            
        </div>
      </div>
    )
  }
}
